 (50,'Becetto - Bagnour','johnlaroccia@gmail.com',19.4323458528139,9.71617292640696,736.8505859375,'HIKER',67,68,44.6010041423142,7.13986395858228,'Partendo dal lavatoio posto sulla piazza di Becetto, imbocchiamo la discesa che porta al “Ristorante del Becetto”, con il negozio di alimentari annesso, e costeggiando a valle gli edifici, giungiamo alla borgata Civalleri. Attraversata la piccola frazione, seguiamo l’evidente sentiero che in leggera discesa ci porta a guadare il rio Crosa. Proseguendo sul sentiero in salita e prestando attenzione al percorso molto esposto e attrezzato con catene, arriviamo a meira Roina, costruita su delle rocce particolarmente panoramiche. Da qui in pochi minuti raggiungiamo il rifugio del Preit, vivaio forestale degli anni ’20. Proseguiamo sul sentiero in piano e poi in leggera salita tralasciando il sentiero in discesa che permette di raggiungere in pochi minuti la borgata Chiotti e quindi Sampeyre. Oltrepassiamo le meire Bellocchio, dove imbocchiamo una strada sterrata in discesa a sinistra e ci ricongiungiamo a destra con la strada proveniente dal Chiot. Oltrepassiamo le meire Dueo e giungiamo in località Serre di Raie, interessante gruppo di meire posto in posizione panoramica. ...');
